css:
body {
  font-size: 12px;
  color: #a8a8a8;
  background-color: #002b36;
}
atom-workspace {
  background-color: #002b36;
}
atom-pane {
  border-right: 1px solid #003745;
}
atom-pane:last-child {
  border-right: none;
}
.btn {
  color: #b8b8b8;
  background-color: #005469;
  transition: background-color 0.07s ease-in;
}
.btn:hover,
.btn:focus {
  color: #f0f0f0;
  background-color: #0084a6;
}
.btn:active {
  color: rgba(255, 255, 255, 0.66);
  background-color: #004b5f;
}
.btn.selected {
  color: #ffffff;
  background-color: #005469;
  border-bottom: 1px solid #229bdd !important;
}
.btn:focus,
.btn:focus:active {
  outline: none;
}
.btn.icon::before {
  top: 1px;
  color: #a8a8a8;
}
.btn:hover.icon::before,
.btn:focus.icon::before,
.btn:active.icon::before {
  color: #ffffff;
}
.btn.btn-primary {
  color: #ffffff;
  background-color: #229bdd;
}
.btn.btn-primary:hover,
.btn.btn-primary:focus {
  background-color: #34a3df;
}
.btn.btn-primary:active {
  background-color: #208fcb;
}
.btn.btn-primary.selected {
  background-color: #34a3df;
}
.btn.btn-primary.selected:focus,
.btn.btn-primary.selected:hover {
  background-color: #46abe2;
}
.btn.btn-info {
  color: #ffffff;
  background-color: #229bdd;
}
.btn.btn-info:hover,
.btn.btn-info:focus {
  background-color: #34a3df;
}
.btn.btn-info:active {
  background-color: #208fcb;
}
.btn.btn-info.selected {
  background-color: #34a3df;
}
.btn.btn-info.selected:focus,
.btn.btn-info.selected:hover {
  background-color: #46abe2;
}
.btn.btn-success {
  color: #ffffff;
  background-color: #bdb968;
}
.btn.btn-success:hover,
.btn.btn-success:focus {
  background-color: #c3c076;
}
.btn.btn-success:active {
  background-color: #b7b25a;
}
.btn.btn-success.selected {
  background-color: #c3c076;
}
.btn.btn-success.selected:focus,
.btn.btn-success.selected:hover {
  background-color: #c9c684;
}
.btn.btn-warning {
  color: #ffffff;
  background-color: #e2c08d;
}
.btn.btn-warning:hover,
.btn.btn-warning:focus {
  background-color: #e6c99d;
}
.btn.btn-warning:active {
  background-color: #deb77d;
}
.btn.btn-warning.selected {
  background-color: #e6c99d;
}
.btn.btn-warning.selected:focus,
.btn.btn-warning.selected:hover {
  background-color: #ead2ae;
}
.btn.btn-error {
  color: #ffffff;
  background-color: #cc6666;
}
.btn.btn-error:hover,
.btn.btn-error:focus {
  background-color: #d17575;
}
.btn.btn-error:active {
  background-color: #c75757;
}
.btn.btn-error.selected {
  background-color: #d17575;
}
.btn.btn-error.selected:focus,
.btn.btn-error.selected:hover {
  background-color: #d68585;
}
.btn-group > .btn {
  border-color: rgba(0, 0, 0, 0.2);
}
atom-text-editor.editor .bracket-matcher .region {
  border: 1px solid #797979;
  background-color: #005469;
}
atom-overlay.autocomplete-plus {
  font-size: 14px;
}
atom-overlay .datatip-overlay,
atom-overlay .datatip-overlay .datatip-container {
  background-color: #003f50;
}
atom-text-editor[mini] {
  padding-top: 3.33333333px;
  padding-left: 5px;
  color: #a8a8a8;
  border-radius: 2px;
  background-color: #00232c;
}
atom-text-editor[mini].is-focused {
  background-color: #001d24;
}
atom-text-editor[mini] .placeholder-text {
  color: #808080;
}
atom-text-editor[mini] .selection .region {
  background-color: #005469;
}
.find-and-replace {
  border-top: 1px solid #003745;
}
.status {
  color: #a8a8a8;
}
.status-added {
  color: #bdb968 !important;
}
.status-ignored {
  color: #808080 !important;
}
.status-modified {
  color: #e2c08d !important;
}
.status-removed {
  color: #cc6666 !important;
}
.status-renamed {
  color: #81a2be !important;
}
.key-binding {
  display: inline-block;
  margin-left: 1px;
  padding: 0 5px;
  line-height: 2;
  font-family: 'Helvetica Neue', Arial, sans-serif;
  font-size: .8em;
  letter-spacing: 1px;
  border-radius: 2px;
  background-color: #00232c;
}
.list-group li {
  padding-left: 5px;
}
.list-group li.selected {
  color: #ffffff;
  background-color: #005469;
}
.list-group li.selected:before {
  display: none;
}
.list-tree {
  color: #a8a8a8;
}
.list-tree .selected {
  color: #ffffff;
}
.select-list li {
  padding: 5px 10px;
}
.select-list .status {
  float: right;
}
.select-list.popover-list {
  padding: 5px;
  border-radius: 2px;
  background-color: #003f50;
  box-shadow: 0 2px 8px 1px rgba(0, 0, 0, 0.3);
}
.select-list.popover-list .list-group {
  margin-top: 5px;
}
.select-list.popover-list .list-group li {
  padding-left: 5px;
}
atom-dock .atom-dock-resize-handle.left {
  position: absolute;
  right: 0;
  width: 4px;
  height: 100%;
  z-index: 1000;
}
atom-dock .atom-dock-resize-handle.right {
  position: absolute;
  left: 0;
  width: 4px;
  height: 100%;
  z-index: 1000;
}
atom-dock .atom-dock-resize-handle.bottom {
  position: absolute;
  top: 0;
  width: 100%;
  height: 4px;
  z-index: 1000;
}
atom-dock .pane .tab-bar .tab .title::before {
  display: none;
}
atom-panel-container.left {
  border-right: 1px solid #003745;
}
atom-panel-container.right {
  border-left: 1px solid #003745;
}
atom-panel-container.bottom {
  border-top: 1px solid #003745;
}
.panel-heading {
  border-bottom: 1px solid #003745;
  background-color: #003b4a;
}
.inset-panel {
  background-color: #003b4a;
}
.inset-panel .panel-heading {
  background-color: #004b5f;
}
atom-panel.modal {
  border: 1px solid #003745;
  border-top: none;
  box-shadow: 0 2px 8px 1px rgba(0, 0, 0, 0.3);
}
.diagnostics-ui .nuclide-ui-toolbar .nuclide-ui-toolbar__left .nuclide-btn-group .btn {
  width: 26px;
}
.diagnostics-ui .nuclide-ui-table-header .nuclide-ui-table-header-cell:last-child {
  border-right: none;
}
.diagnostics-ui .nuclide-ui-table-body .nuclide-ui-table-row .nuclide-ui-table-body-cell:last-child {
  border-right: none;
}
.loading-spinner-large {
  display: block;
  width: 64px;
  height: 64px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 64px 64px;
}
.loading-spinner-large.inline-block {
  display: inline-block;
}
.loading-spinner-medium {
  display: block;
  width: 48px;
  height: 48px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 48px 48px;
}
.loading-spinner-medium.inline-block {
  display: inline-block;
}
.loading-spinner-small {
  display: block;
  width: 32px;
  height: 32px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 32px 32px;
}
.loading-spinner-small.inline-block {
  display: inline-block;
}
.loading-spinner-tiny {
  display: block;
  width: 16px;
  height: 16px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 16px 16px;
}
.loading-spinner-tiny.inline-block {
  display: inline-block;
}
.ui-site-1 {
  background-color: #0088ff;
}
.ui-site-2 {
  background-color: #20b684;
}
.ui-site-3 {
  background-color: #cc8533;
}
.ui-site-4 {
  background-color: #D831B0;
}
.ui-site-5 {
  background-color: #EBDD5B;
}
.status-bar {
  font-size: 11px;
  color: #a8a8a8;
  border-top: 1px solid #003745;
  background-color: #003340;
}
.status-bar a {
  text-decoration: none;
}
.status-bar .diagnostics-status-bar-highlight {
  margin: 0 5px;
}
.status-bar .diagnostics-status-bar-highlight .icon {
  display: none;
}
atom-dock .tab {
  border: 0 !important;
}
atom-dock .tab .title {
  color: #808080;
  text-transform: uppercase;
}
atom-dock .tab .title:hover {
  color: #a8a8a8;
}
atom-dock .tab.active:hover .close-icon {
  color: #808080;
}
atom-dock .tab.active:hover .close-icon:hover {
  color: #ffffff;
}
atom-dock .tab.active:hover .close-icon::after {
  color: #808080 !important;
}
atom-dock .tab.active:not(:hover) .close-icon::after {
  color: #808080 !important;
}
.tab-bar {
  background-color: #002b36;
  border-bottom: 1px solid #003745;
}
.tab-bar .tab {
  color: #a8a8a8;
  height: 30px;
  line-height: 30px;
  font-size: 12px;
  border-right: 1px solid #003745;
  background-color: #002b36;
}
.tab-bar .tab:last-child {
  border-right: 0;
}
.tab-bar .tab.active {
  color: #ffffff;
  background-color: #002b36;
}
.tab-bar .tab.active:hover .close-icon {
  color: #808080;
}
.tab-bar .tab.active:hover .close-icon:hover {
  color: #ffffff;
}
.tab-bar .tab.active:not(:hover) .close-icon {
  color: #002b36;
}
.tab-bar .tab.active:not(:hover) .close-icon::after {
  display: inline-block;
  position: relative;
  top: 1px;
  margin-left: 5px;
  color: #ffffff;
  content: "↩︎";
}
.tab-bar .tab .close-icon {
  color: #808080;
}
.tab-bar .tab .close-icon:hover {
  color: #ffffff;
}
.tab-bar .tab.active .close-icon:hover {
  color: #a8a8a8;
}
.tab-bar .tab.modified:not(:hover) .close-icon {
  top: 50%;
  right: 14px;
  margin-top: -3px;
  border-color: #81a2be;
}
.tab-bar .tab.modified:not(:hover) .close-icon::after {
  content: "";
}
.tab-bar .tab.modified:hover .close-icon {
  color: #808080;
}
.tab-bar .tab.is-dragging {
  background: #000203;
  border-color: transparent;
  opacity: .5;
}
.tab-bar .tab.is-dragging .close-icon {
  visibility: hidden;
}
.text-smaller {
  font-size: smaller;
}
.text-subtle {
  color: #808080;
}
.text-highlight {
  color: #f0f0f0;
}
.text-info {
  color: #81a2be;
}
.text-success {
  color: #bdb968;
}
.text-warning {
  color: #e2c08d;
}
.text-error {
  color: #cc6666;
}
.highlight {
  padding: 1px 4px;
  color: #f0f0f0;
  border-radius: 2px;
  background-color: #003f50;
}
.highlight-info {
  padding: 1px 4px;
  color: #f0f0f0;
  border-radius: 2px;
  background-color: #229bdd;
}
.highlight-warning {
  padding: 1px 4px;
  color: #f0f0f0;
  border-radius: 2px;
  background-color: #e2c08d;
}
.highlight-error {
  padding: 1px 4px;
  color: #f0f0f0;
  border-radius: 2px;
  background-color: #cc6666;
}
.highlight-success {
  padding: 1px 4px;
  color: #f0f0f0;
  border-radius: 2px;
  background-color: #bdb968;
}
.background-message {
  font-weight: bold;
  color: #808080;
}
.tooltip .tooltip-inner {
  line-height: 1;
  padding: .75em;
  white-space: nowrap;
  max-width: none;
}
.tooltip .keystroke {
  padding: .15em .4em;
  margin: 0 -0.3em 0 0.25em;
  border-radius: 2px;
  color: #ffffff;
  background: #005469;
}
.tree-view {
  color: #a8a8a8;
  background-color: #002b36;
}
.tree-view .list-item.selected {
  color: #ffffff;
}
.tree-view .project-root::before {
  left: 0;
  right: 0;
  height: 25px !important;
  background-color: rgba(34, 153, 221, 0.7);
}
.tree-view .project-root-header::before {
  top: 0 !important;
  color: #fff;
}
.tree-view .project-root-header span.name {
  color: #fff;
  transition: background-color 0.1s ease-in;
  padding: 5px 15px;
  font-family: Menlo;
  text-transform: uppercase;
  cursor: pointer;
}
.tree-view .project-root-header span.name::before {
  content: none;
}
.settings-view .config-menu {
  background-color: #002b36;
}
.settings-view .panels .package-container .package-card {
  background-color: #003340;
}
